// Erfaringer.js
import React from 'react';
import Banner from "src/components/banner.js";
import Footer from "src/components/footer.js";
import "src/styles/erfaringer.css";

function Article(){
    return <div class="articleErfaringer">
        <h1>Her er et udsnit af, hvad andre har gjort sig af erfaringer, og nogle af de skønne bemærkninger jeg dagligt hører:</h1>
    </div>;
}

function Aside(){
    return <div class="asidedeErfaringer"></div>;
}

function Erfaringer(){
    return <div class="grid" style={{width: "70vw", margin: "auto"}}>
        <Banner/>
        <Article/>
        <Aside/>
        <Footer/>
    </div>;
}

export default Erfaringer;
